import React, { Component } from "react"
import Button from "./button"

class Chat extends Component {
    handleLogout = () => {}
    handleAddFriend = () => {}
    handleAddGroup = () => {}

    render() {
        return (
            <div>
                <div className="header">
                    <button name="L" onClick={this.handleLogout} />
                    <button name="Friend" onClick={this.handleAddFriend} />
                    <button name="Group" onClick={this.handleAddGroup} />
                </div>
                <div className="list"></div>
                <div className="display"></div>
                <div className="footer"></div>
            </div>
        )
    }
}

export default Chat
